    VentaComponent.prototype.redondeoDecimales = function (numero) {
        var redondeado = Math.round((numero) * Math.pow(10, 4)) / Math.pow(10, 4);
        return redondeado;
    };
    VentaComponent.prototype.calcularDescuentoProd = function () {
        var precio;
        var desc;
        if (this.productoIngresar.fk_descuento != '' && this.productoIngresar.fk_descuento != null && this.productoIngresar.fk_descuento != undefined) {
            // console.log('tiene descuento');
            desc = this.productoIngresar.descuento / 100;
            this.productoIngresar.descuentoValor = this.redondeoDecimales((this.productoIngresar.prod_precioVenta * desc));
            precio = this.redondeoDecimales((this.productoIngresar.prod_precioVenta - this.productoIngresar.descuentoValor));
            this.productoIngresar.descuentoTotal = precio;
            // console.log('precio: ', precio);
        }
        else if (this.productoIngresar.fk_descuento == '' || this.productoIngresar.fk_descuento == null || this.productoIngresar.fk_descuento == undefined) {
            // console.log('no tiene descuento');
            precio = this.productoIngresar.prod_precioVenta;
        }
        return precio;
    };
    VentaComponent.prototype.calcularTotalCaja = function () {
        // console.log(this.productoIngresar);
        // calcular el descuento
        var precioProducto = this.calcularDescuentoProd();
        // productos con iva
        if (this.productoIngresar.iva == true) {
            var iva = void 0;
            iva = 1 + (this.ivaActual / 100);
            // precio de venta sin iva
            this.productoIngresar.subtotalprecioventa = this.redondeoDecimales((precioProducto / iva));
            // cantidad de iva descontada total (iva*unidades)
            var ivaProd = void 0;
            ivaProd = precioProducto - this.productoIngresar.subtotalprecioventa;
            this.productoIngresar.ivatotal = this.redondeoDecimales((ivaProd * this.productoIngresar.unidades));
            // subtotal = precio sin iva * unidades
            this.productoIngresar.subtotal = this.redondeoDecimales((this.productoIngresar.subtotalprecioventa * this.productoIngresar.unidades));
            // total = subtotal + iva total
            this.productoIngresar.total = this.redondeoDecimales((this.productoIngresar.subtotal + this.productoIngresar.ivatotal));
        }
        else 
        // productos sin iva
        if (this.productoIngresar.iva == false) {
            // seteo a 0 de valores que solo se ocupan con iva
            this.productoIngresar.subtotalprecioventa = this.productoIngresar.prod_precioVenta;
            this.productoIngresar.ivatotal = 0;
            // subtotal a pagar = unidad por precio de venta
            this.productoIngresar.subtotal = this.redondeoDecimales((this.productoIngresar.unidades * precioProducto));
            // total = subtotal
            this.productoIngresar.total = this.productoIngresar.subtotal;
        }
    };
    VentaComponent.prototype.cacularTotales = function () {
        // console.log(this.venta.fk_cliente);
        if (this.productoIngresar.prod_stock >= this.productoIngresar.unidades) {
            this.productoIngresar.stock_sig = parseInt(this.productoIngresar.prod_stock) - parseInt(this.productoIngresar.unidades);
            this.errorProducto = false;
            this.calcularTotalCaja();
            this.calcularFactura();
        }
        else {
            this.errorProducto = true;
            this.productoIngresar.total = 0;
        }
    };
